import React from "react";
import {FaGithub} from "react-icons/fa";
import './ProjectsStyles.css'

function displayProjects(projects_dictionary){
    return (<div id="list">
        <h1>Projects</h1>
        <div id="box">
            <div classname="project-card">
                <img classname="proj_img" src={projects_dictionary.proj0[1]}></img>
                <div classname="description">
                    <p classname="title">{projects_dictionary.proj0[0]}</p>
                </div>
            </div>
        </div>
        
    </div>)
}



function Projects() {

    const projects_dictionary = {
        "proj0": ["Online Auction System", "Photo Placeholder", "Description", "Github Link"]
        
    }

    return (
        projects_dictionary.forEach((value, key) => {
            console.log(value)
            console.log(key)
            
        })
    )
}


/* <div id="box">
    <div classname="project-card">
        <img classname="proj" src=""></img>
        <div classname="description">
            <p classname="title">Online Auction System</p>
            <p>Placeholder</p>
            <a href="https://github.com/JuanAracena/OnlineAuctionSystem"><FaGithub size="4em"/></a>
        </div>
    </div>
    
</div> */
export default Projects
